import React from 'react'; // Library react-JS
import {View,Text} from 'react-native'; // Library raect-JS

const App = () => {
  return(
      <View styles={{
          flex: 1,
          justifyContent: 'center',
          alignItems: 'center',
      }}>
          <Text>IU</Text>
      </View>
  )
}

export default App;
